-------------------------------------------------------------------------
-- Criar e carregar a tabela Estacoes da base Estações Meteorológicas  --
-- Aeroportos(com código ICAO possuem estações meteorológicas          --
-- http://bancodedados.cptec.inpe.br/tabelaestacoes/faces/consulta.jsp --
-------------------------------------------------------------------------
-- Postgres e Oracle. executar direto no ISQL                          --
-------------------------------------------------------------------------
-- [.].*[.][^,]*[)]
-- [)][^,]*[,][^,]*[,][^,]*[,][^,]*[,][^,]*[,][^,][)]

create table Estacoes (
    País       char(2) NOT NULL,
    WMO        char(5),
    ICAO       char(4),
    Estacao    varchar(70) NOT NULL,
    Latitude   decimal(7,4),
    Longitude  decimal(7,4), 
    Altitude   decimal(7,2)
    );


SELECT Count(*) From Estacoes;
